		public static void SendMessage(string type, string message) {
			if (Connected) {
				try {
					//if (type == "contacts") new Exception().PrintStackTrace();
					//if (type == "text") Debug.WriteLine(message.Split(";").Length);
					serverOut.WriteLine(new Message(type, message));
					Debugger.Log(0, null, $"Sent {type}:{message}" + "\r\n");
				}
				catch (Exception e) {
					e.PrintStackTrace();
				}
			}
			else Debug.WriteLine("Tried to send message, but isn't connected to the server!");
		}

		// TODO: think of better name for Text in Message
		private record Message(string Type, string Text) {
			public override string ToString() => $"{Type}:{Text}";
		}
